<template>
  <view class="body">
    <view class="center">
      <view @click="next('dog')" class="kuai box">
        <text>文章生成器</text>
      </view>
      <view @click="next('house')" class="kuai box">
        <text>房贷计算器</text>
      </view>
      <view @click="next('poetry')" class="kuai box">
        <text>古诗拼接</text>
      </view>
      <view @click="next('slscq')" class="kuai box">
        <text>申论生成器</text>
      </view>
	  <view @click="next('idcard','pagesA')" class="kuai box">
	    <text>身份证归属地</text>
	  </view>
      <view class="kuai box">
        <text>敬请期待....</text>
      </view>
    </view>
  </view>
</template>

<script>
export default {
  data() {
    return {
      code: "", //临时登录code
      openid: "",
      token: "",
      loading: false,
    };
  },
  onLoad() {
 //    this.getToken();
	// this.getOpenId()
	
    uni.showShareMenu({
      menus: ["shareAppMessage", "shareTimeline"],
    }); //可分享
    uni.checkSession({
      success: (res) => {
        console.log("有效期", res);
		uni.getStorage({
			key:"token",
			success:res=>{
				
				let time=res.data.time
				let endTime=Date.now()
				console.log('获取token',res,endTime);
				if(endTime-time>7000000){
					// token有效时间俩小时
					this.getToken()
				}
			},
			fail:()=> {
				console.log('没有获取到token');
				this.getToken()
			}
		})
		uni.getStorage({
			key:'openid',
			fail:()=> {
				console.log('没有获取到openid');
				this.login()
			}
		})
      },
      fail: (err) => {
        console.log("过期", err);
        if (!this.loading) {
          uni.showLoading({
            title: "登录中...",
          });
          this.loading = true;
          this.login();
        }
      },
    });
  },
  methods: {
    next(n,page) {
      if (this.loading) return;
      uni.navigateTo({
        url: `/${page?'pagesA':'pages'}/${n}/index`,
      });
    },
    getOpenId(code) {//获取openid
      uniCloud
        .callFunction({
          name: "getOpenId",
          data: {
            code:code|| this.code,
          },
        })
        .then((res) => {
			// console.log('获取openid',res.result);
			let openid=res.result.openid
			uni.setStorage({
				key:'openid',
				data:{
					openid
				}
			})
			if(this.loading){
				this.loading=false
				uni.hideLoading()
			}
		});
    },
    getToken() {
      //获取token
	  if(!this.loading){
		  this.loading=true
		  uni.showLoading({
		  	title:"登录中..."
		  })
	  }
      uniCloud
        .callFunction({
          name: "getToken",
        })
        .then((res) => {
          // console.log("获取token", res);
          let access_token = res.result.access_token;
          uni.setStorage({
            key: "token",
            data: {
              token: access_token,
              time: Date.now(),
            },
          });
        });
		if(this.loading){
			this.loading=false
			uni.hideLoading()
		}
    },
    login() {
      const _this = this;
      uni.login({
        provider: "weixin", //使用微信登录
        success: (loginRes) => {
          console.log("登录情况", loginRes);
          _this.code = loginRes.code;
		  this.getOpenId(loginRes.code)
		  this.getToken()
        },
      });
    },
  },
};
</script>

